            gtag('event', 'form_submit');
            
            if(user.id) {
                submitFormData();
            }
        })

        async function submitFormData() {
            let fd = new FormData(myForm);
            let data = Object.fromEntries(fd.entries());

            // loding animation on submit data
            let element = document.getElementById("data-submit-btn")
            element.classList.add('button--loading');

            await user.updateData(data);
            location.href = "https://www.asknavigator.com/user/?q=" + localStorage.userId;
        }

    </script>

    <!-- ===== data colaction === -->
    <script>
        // DATA COLLECTOR

        var log = message => console.log(message);

        const API_URL = "https://api.asknavigator.com/user";
        var customFetch = async (url, data) => {

            let result = await fetch(url, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            result = await result.json();
            console.log(result);
            return result;
        }

        class User {
            data = {}

            get id() {
                return localStorage.userId;
            }

            set id(userId) {
                localStorage.userId = userId;
            }

            constructor() {
                if (localStorage.user) {
                    this.data = JSON.parse(localStorage.user);
                }
            }

            async updateData(data) {
                this.data = data;
                await this.update();
            }

            async updateKey(key, value) {
                console.log(key, value);
                this.data[key] = value;
                await this.update();
            }

            async update(){
                console.log("Updated user: ", this.data);

                // save locally
                localStorage.user = JSON.stringify(this.data);

                // create or update user
                if (this.id) {
                    await this.updateServer();
                } else {
                    await this.create();
                }
            }

            async create() {
                if(userCreateRequested) return;
                userCreateRequested = true;
                log("Create user!");
                let result = await customFetch(`${API_URL}/create.php?notify=created`, this.data);
                if (result["id"]) this.id = result["id"];

                if(formSubmitRequested) {
                    submitFormData();
                }
            }

            async updateServer() {
                log("Update user!");
                let result = await customFetch(`${API_URL}/update.php?id=${this.id}`, this.data);
            }
        }


        let user = new User();
        user.data.page = location.href;
        user.data.collect = '<?php echo $city; ?>';
        user.data.ref = document.referrer;


    </script>
